import React from 'react';
import { Navbar, Nav, Container, NavDropdown } from 'react-bootstrap';
import { Link, useNavigate } from 'react-router-dom';

const NavbarMenu = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <Navbar bg="dark" variant="dark" expand="lg" fixed="top">
      <Container>
        <Navbar.Brand as={Link} to="/dashboard">Správa Zamestnancov</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/employees">Zamestnanci</Nav.Link>
            <Nav.Link as={Link} to="/company-items">Firemné Dáta</Nav.Link>
            <Nav.Link as={Link} to="/projects">Projekty</Nav.Link>
            <Nav.Link as={Link} to="/create-profile">Vytvoriť Profil</Nav.Link>
            <NavDropdown title="Môj Účet" id="basic-nav-dropdown">
              <NavDropdown.Item as={Link} to="/edit-profile">Upraviť Profil</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item onClick={handleLogout}>Odhlásiť sa</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavbarMenu;
